import React, { useEffect } from 'react';
import axios from 'axios';
import Navbar from "../NavBar/NavBar";

function LandingPage() {
    useEffect(() => {
        axios.get('/')
            .then(response => {
                console.log(response);
            })
            .catch(error => {
                console.error(error);
            });
    }, []);

    return (
        <div>
        <LandingPage />
            <Navbar />
        </div>
    );
}

export default LandingPage;
